pragma solidity 0.5.16;

library InsertionSorter {


  function sort(uint[] storage data, address[] storage biddersAddress) public {

    uint n = data.length;
    uint[] memory arr = new uint[](n);
    address[] memory sortedAddresses = new address[](n);
    uint i;

    for(i=0; i<n; i++) {
      arr[i] = data[i];
      sortedAddresses[i] = biddersAddress[i];
    }

    uint key;
    address key2;
    uint j;

    for(i = 1; i < arr.length; i++ ) {
      key = arr[i];
      key2 = sortedAddresses[i];
      for(j = i; j > 0 && arr[j-1] > key; j-- ) {
        arr[j] = arr[j-1];
        sortedAddresses[j] = sortedAddresses[j-1];
      }

      arr[j] = key;
      sortedAddresses[j] = key2;
    }

    for(i=0; i<n; i++) {
      data[i] = arr[i];
      biddersAddress[i] = sortedAddresses[i];
    }

  }

}
